import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './home.css';
import Media from 'react-bootstrap/Media';

// Importing the main homepage svg picture
import Teampic from '../images/teamates.svg';

class investors extends React.Component {
     render(){
          return(
               <div className="Home">
                    <h1>Startvest</h1>
                    {/* <div id='mainImage'><img id='team_bg' width={200} height={200} src={Teampic} alt="teamates discussing" /></div> */}
                    <Media>
                         <Media.Body>
                         <h5>Media Heading</h5>
                         <p className='home'>
                              Cras sit amet nibh libero, in gravida nulla. Nulla vel metus scelerisque
                              ante sollicitudin commodo. Cras purus odio, vestibulum in vulputate at,
                              tempus viverra turpis. Fusce condimentum nunc ac nisi vulputate fringilla.
                              Donec lacinia congue felis in faucibus.
                         </p>
                         </Media.Body>
                         <img width={700} height={700} className="ml-3" src={Teampic} alt="teamates discussing"  />
                    </Media>
               </div>
          )
          
     }
}
export default investors;
